export default {
  namespaced: true,
  state: {
    user: {
      id: "",
      username: "",
      avatar: require("../assets/avatar.png")
    },
    isAuth: false,
    selectedFile: null,
    url: "data:image/jpeg;base64,"
  },
  mutations: {
    SET_USER(state, payload) {
      state.user = payload;
    },
    DELETE_USER(state) {
      state.user = {};
    },
    IS_AUTH(state, payload) {
      state.isAuth = payload;
    },
    CHANGE_AVATAR(state, payload) {
      state.user.avatar = payload;
    },
    UPLOAD_AVATAR(state, payload) {
      state.selectedFile = payload;
    },
    SET_URL(state, payload) {
      state.url = payload
    }
  },
  actions: {
    setUser({ commit }, payload) {
      commit("SET_USER", payload);
    },
    deleteUser({ commit }) {
      commit("DELETE_USER");
    },
    IS_AUTH({ commit }, payload) {
      commit("IS_AUTH", payload);
    },
    changeAvatar({ commit }, payload) {
      commit("CHANGE_AVATAR", payload);
    },
    setUrl({ commit }, payload){
      commit("SET_URL", payload)
    }
  }
};
